import React, { Component  } from "react";
import LoginPage from "../Page/LoginPage/LoginPage";


import {
  BrowserRouter as Router,
  Switch,
  Route,
} from "react-router-dom";


class App extends Component {

  render(){
    return (

      <div className="App">
        <Router>

          <Switch>

          <Route path="/">
            <LoginPage />

          </Route>

          </Switch>


        </Router>

    </div>
  );
  }
}

export default App;
